import React from "react";

function Jumbotron(){

    return(
        <div>
            <div class="jumbotron jumbotron-fluid bg-dark">
            <a href="default.asp">
                <img src={ require('./images/Twitter-Logo.png') } alt="HTML tutorial" class="iconLink"/>
            </a>

            </div>
        </div>

    );
}

export default Jumbotron;
